import React from 'react'

class Especialidad extends React.Component{
    render (){
        return (
            <div id='especialidad' className='bg-white pt-3 pb-3'>
                <div className='container'>
                    <p className='cl-black fs-28 text-align-center mb-1'>Nuestras especialidades</p>
                    <div className='d-flex justify-content-center'>
                        <img src='https://www.elhuarike.com/images/especialidades/LINEA_DOBLE_AZUL.png' style={{width: '86px', height: '20px'}}/>
                    </div>
                    <p className='cl-black fs-16 text-align-center mb-1'>Ven y prueba los mejores platos marinos de nuestra carta con una sazón que sólo en El Huarike podrás encontrar.</p>
                    <br/>
                    <br/>
                    <p className='cl-black fs-16 text-align-center mb-1'>Te invitamos a descubrir nuestras especialidades</p>
                </div>
            </div>
        )
    }
}

export default Especialidad
